import React, { Component } from "react";
import { any } from "prop-types";

const obj = {
  match: {
    params: {
      id: any
    },
    url: any
  }
};

class Param extends Component {
  render() {
    return (
      <div>
        <h1>{props.match.params.id}</h1>
      </div>
    );
  }
}

export default Param;

